import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { startGetWishlists } from '../Actions/wishlist';
import { Card, Container, Row, Col } from 'react-bootstrap';
import '../../index.css';

const WishlistItems = () => {
  const dispatch = useDispatch();
  const wishlistItems = useSelector(state => state.wishlist.data);
  console.log(wishlistItems);

  useEffect(() => {
    dispatch(startGetWishlists());
  }, [dispatch]);

  return (
    <Container style={{ paddingTop: '40px' }}>
      <h2>Wishlist Items</h2>
      <Row>
        {wishlistItems.map((item, index) => (
          <Col key={index} md={4} className="mb-4">
            <Card>
              <Card.Img variant="top" src={`http://localhost:3009/${item.images}`} />
              <Card.Body>
                <Card.Title>{item.caption}</Card.Title>
                <Card.Text>
                  Price: {item.price}
                </Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default WishlistItems;
